import React from "react";
import { useLocation } from "react-router-dom";

const ModeChoice = () => {
    const location = useLocation();
    const distance = location.state.distance
    // console.log(distance);

    let mode;
    if (distance === "<5km") {
        mode = "Walk / Bicycle";
    } else {
        mode = "Metro";
    }

    return (
        <div>
            <h1>Mode Choice</h1>

            <table>
                <tr>
                    <th>Bus Type 1</th>
                    <th>Bus Type 2</th>
                    <th>{mode}</th>
                </tr>
                <tr>
                    <td>Alfreds Futterkiste</td>
                    <td>Maria Anders</td>
                    <td>Maria Anders</td>
                </tr>
            </table>
        </div>
    );
};

export default ModeChoice;
